import React from "react";
import { Link } from 'react-router-dom';
import "./LandingPage.css"; // Import associated CSS

const LandingPage = () => {
  return (
    <div className="landing-container">
      {/* Background elements */}
      <div className="background-shapes">
        <div className="shape shape-blue" />
        <div className="shape shape-teal" />
      </div>

      {/* Hero content */}
      <div className="hero-content">
        <h1 className="hero-title">Your Data Science Career Starts Here</h1>

        <div className="button-group">
          <Link className="btn btn-primary" aria-label="Sign in" to="/signin">
            Sign In
          </Link>
          <Link className="btn btn-secondary" aria-label="Sign up" to="/signup">
            Sign Up
          </Link>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
